import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      {/* Header */}
      <div className="app_header">
        <img 
          className="Header-Image"
          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt=""
        />
      </div>


    </div>
  );
}

export default App;
